import React, { Component } from 'react';

class Projects extends Component {
  username = 'viviannemelo';  // <-- aqui, fora dos métodos

  state = {
    repos: [],
  };

  componentDidMount() {
    fetch(`https://api.github.com/users/${this.username}/repos`)
      .then((res) => res.json())
      .then(async (repos) => {
        const projectsWithImage = await Promise.all(
          repos
            .filter((repo) => !repo.fork)
            .map(async (repo) => {
              const imageUrl = `https://raw.githubusercontent.com/${this.username}/${repo.name}/main/cover.png`;
              const res = await fetch(imageUrl);
              return {
                ...repo,
                coverExists: res.ok,
                coverUrl: imageUrl,
              };
            })
        );
        this.setState({ repos: projectsWithImage });
      });
  }

  render() {
    return (
      <section id="projects">
        <h2>Projects</h2>
        <div className="projects">
          {this.state.repos.map((repo) => (
            <div className="project" key={repo.id}>
              {repo.coverExists && (
                <img
                  src={repo.coverUrl}
                  alt={`Image of ${repo.name}`}
                  className="project-img"
                />
              )}
              <h3>{repo.name}</h3>
              <p>{repo.description || 'No description available.'}</p>
              <a
                href={repo.html_url}
                target="_blank"
                rel="noopener noreferrer"
              >
                View on GitHub →
              </a>
              <br />
              <a
                href={`https://${this.username}.github.io/${repo.name}`}
                target="_blank"
                rel="noopener noreferrer"
              >
                View Live Project →
              </a>
            </div>
          ))}
        </div>
      </section>
    );
  }
}


